import React from "react";
import Header from "./Components/Header";
import Features from "./Components/Features";
import Services from "./Components/Services";
import Subscribe from "./Components/Subscribe";

function App() {
  return (
    <div className="App">
      <Header />
      <Features />
      <Services />
      <Subscribe />
    </div>
  );
}

export default App;
